import { Container } from "react-bootstrap";
function Footer() {
  return (
    <>
      <section
        style={{
          bottom: "0",
          width: "100%",
          backgroundColor: "#2C3539",
          color: "#fff",
          padding: "10px",
        }}
      >
        <Container>
          <a
            href="https://portfolio-polu-sai-ashish.web.app/"
            target="_blank"
            rel="noreferrer"
            style={{
              textDecoration: "none",
              color: "white",
            }}
          >
            Know or Contact Me?
          </a>
        </Container>
      </section>
    </>
  );
}
export default Footer;
